const orangeTheme = {
	colors: {
		background: '#505050',
		opposite: '#ffffff',

		Primary: '#A68350',
		Secondary: '#DEAD63',
		Tertiary: '#FFC977',
		Quaternary: '#FFE3B9',
		Quinary: '#FFF8ED',
	},
};

export default orangeTheme;
